import ServiceCard from './ServiceCard';
const data = [
  { key: 'hair', title: 'Hair Cutting', subtitle: 'Latest cuts aur styling', items:[
    {name:'Classic Bob', price:500}, {name:'Layered Cut', price:700}, {name:'Pixie Cut', price:800},
  ]},
  { key: 'makeup', title: 'Beauty / Makeup', subtitle: 'Bridal aur party makeup', items:[
    {name:'Day Makeup', price:1200}, {name:'Party Glam', price:1800}, {name:'Bridal Makeup', price:5000},
  ]},
  { key: 'mehendi', title: 'Mehendi', subtitle: 'Simple se intricate designs', items:[
    {name:'Simple Design', price:300}, {name:'Half-hand', price:800}, {name:'Full Bridal', price:2500},
  ]}
];
export default function Services(){
  return (
    <section id='services' className='max-w-6xl mx-auto px-4 py-12'>
      <h2 className='text-2xl font-bold mb-6 text-strong'>Humare Services</h2>
      <div className='grid gap-6 md:grid-cols-3 sm:grid-cols-2'>
        {data.map(s=> <ServiceCard key={s.key} {...s} />)}
      </div>
      <div id='contact' className='mt-10 text-gray-700'>
        <h3 className='font-semibold text-lg text-strong'>Contact</h3>
        <p className='mt-1'>Phone / WhatsApp: <strong>+91 XXXXXXXXXX</strong></p>
        <p className='text-sm text-gray-500 mt-1'>Address: Aap yahan address likh sakte hain.</p>
      </div>
    </section>
  );
}
